import React from 'react'

function Favorited({FormData}) {
  return (
    <div>
      <img src={FormData.avatar} alt="avatar" />
      <h3>{FormData.username}</h3>
      <h3>{FormData.location}</h3>
      <h3>{FormData.age}</h3>
      <h3>{FormData.timestamp}</h3>
    </div>
  );
}

export default Favorited
